import styled from '@emotion/styled'
import { typography, space, color } from 'styled-system'

const Box = styled('div')(
  typography,
  space,
  color
)

function App() {
  return (
    <Box
      fontSize={4}
      fontWeight='bold'
      p={3}
      mb={[ 4, 5 ]}
      color='white'
      bg='primary'>
      Hello
    </Box>
  );
}

export default App;
